/**
 * @param {number[]} nums1
 * @param {number[]} nums2
 * @return {number}
 */
var minOperations = function(nums1, nums2) {
    let n = nums1.length;
    let maxNums1 = Math.max(...nums1);
    let maxNums2 = Math.max(...nums2);
    let operations = 0;

    if (nums1[n - 1] == maxNums1 && nums2[n - 1] == maxNums2) {
        return 0;
    }

    for (let i = 0; i < n; i++) {
        if ((nums1[i] != maxNums1 || nums2[i] != maxNums2) && (nums1[i] == maxNums2 || nums2[i] == maxNums1)) {
            [nums1[i], nums2[i]] = [nums2[i], nums1[i]];
            operations++;
            if (nums1[n - 1] == Math.max(...nums1) && nums2[n - 1] == Math.max(...nums2)) {
                return operations;
            }
        }
    }

    if (nums1[n - 1] != Math.max(...nums1) || nums2[n - 1] != Math.max(...nums2)) {
        return -1;
    }

    return operations;
};
